import { useNavigate, useParams } from "react-router-dom";
import useFetch from "./useFetch";

const Exam = () => {
  const { id, question } = useParams();
  const {
    data: questions,
    isPending,
    error,
  } = useFetch("http://localhost:8000/questions?examID=" + id);

  return (
    <div className="exam-frame">
      {isPending && <div>Loading...</div>}
      {error && <div>{error}</div>}
      {questions &&
        questions.map((question) => {
          <div>
            <p>{question.question}</p>
          </div>;
        })}
    </div>
  );
};

export default Exam;
